var title_f10_17_10520="Femoral nerve anatomy";
var content_f10_17_10520=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F66562%7ESURG%2F52007&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F66562%7ESURG%2F52007&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 504px\">",
"   <div class=\"ttl\">",
"    Femoral nerve anatomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 484px; height: 655px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The femoral nerve (L2-L4) emerges at the lower border between the psoas and iliacus muscles, and passes beneath the inguinal ligament. The femoral nerve provides motor branches to thigh extensors, sensation to the anterior thigh, femur, knee joint, and medial leg. The saphenous nerve is the extension of the femoral nerve below the knee and is purely sensory.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 513px\">",
"   <div class=\"ttl\">",
"    Saphenous nerve block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 493px; height: 289px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Medial view of the extremity: For saphenous nerve block,&nbsp;the tibial tuberosity is first marked. A subcutaneous ring of local anesthestic is administered posterior to the medial tibial condyle, or alternatively, around the saphenous vein if it is easily visualized with ultrasound.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
