var title_f10_17_10524="Rheumatoid pleural effusion";
var content_f10_17_10524=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F77436&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F77436&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Chronic rheumatoid pleural effusion: Typical abnormalities",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_left\">",
"        Size",
"       </td>",
"       <td>",
"        Small to moderate; unilateral",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Appearance",
"       </td>",
"       <td>",
"        Milky-green, serous, or hemorrhagic",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Protein",
"       </td>",
"       <td>",
"        &gt;3 g/dL (&gt;30 g/L), consistent with an exudate",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Glucose",
"       </td>",
"       <td>",
"        &lt;29 mg/dL (&lt;1.6 mmol/L)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Lactic dehydrogenase (LDH)",
"       </td>",
"       <td>",
"        &gt;700 U/L, consistent with an exudate",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Cholesterol",
"       </td>",
"       <td>",
"        &gt;200 mg/dL (5.18 mmol/L), cholesterol crystals may be present under polarizing light",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        pH",
"       </td>",
"       <td>",
"        &lt;7.20",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Rheumatoid factor",
"       </td>",
"       <td>",
"        &gt;240 IU/mL (&gt;1:320)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\">",
"        Complement",
"       </td>",
"       <td>",
"        Low",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1_left\" rowspan=\"4\">",
"        Cytology",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Cell number:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &lt;5000/mm",
"        <sup>",
"         3",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Cell type:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lymphocytes (neutrophils and eosinophils acutely)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Bouros D, Pneumatikos I, Tzouvelekis A. Pleural involvement in systemic autoimmune disorders. Respiration 2008; 75:361 and Hooper C, Lee YC, Maskell N, BTS Pleural Guideline Group. Investigation of a unilateral pleural effusion in adults: British Thoracic Society Pleural Disease Guideline 2010. Thorax 2010; 65:Suppl 2:ii4.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
